import React from 'react';
import './Home.css';
import logo from "../../assets/logos/UpcycleSkate-logos_black.png";

const Home = () => {
  return (
    <div className="home">
      <div className="home__container">
        <img className="header__logo" src={logo} alt="Upcycle Logo" />
        <img
          className="home__image"
          src="https://images.unsplash.com/photo-1520045892732-304bc3ac5d8e?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2670&q=80"
          alt=""
        />
      </div>

      <div className="home__row"></div>
    </div>
  );
}

export default Home
